import React from "react";

const BookmarkMenu = () => {
    return (
        <div>
          <p>전체 북마크</p>
          <div>
            <button>북마크 추가하기</button>
            <button>폴더 추가하기</button>
          </div>
        </div>
    );
};

export default BookmarkMenu;
